import styled from "styled-components";

export const Leg = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 10px;
  color: #e36600;
`;

export const Ano = styled.input`
  font-size: 20px;
  padding: 4px;
  width: 60px;
  border: 1px solid #e36600;
  color: #e36600;
  border-radius: 4px;
  text-align: center;
  margin-right: 4px;
`;

export const Mes = styled.select`
  font-size: 20px;
  padding: 4px;
  border: 1px solid #e36600;
  color: #e36600;
  border-radius: 4px;
  text-align: center;
`;
